import { Box, Card,    CardActionArea,    Typography } from '@mui/material'
import Slider from "react-slick";
import React from 'react'
import BlogsData from '../../Assets/Data/BlogsData';

import { Stack } from '@mui/system'



const Blogs = () => {

    var settings = {
        className: "slider variable-width",
        centerMode: false,
        dots: true,
        infinite: false,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 3,
        initialSlide: 0,
        responsive: [
          {
            breakpoint: 1024,
            settings: {
              slidesToShow: 3,
              slidesToScroll: 3,
              infinite: true,
              dots: true
            }
          },
          {
            breakpoint: 600,
            settings: {
              slidesToShow: 2,
              slidesToScroll: 2,
              initialSlide: 2
            }
          },
          {
            breakpoint: 480,
            settings: {
              slidesToShow: 1,
              slidesToScroll: 1
            }
          }
        ]
      };
  return (
    <Box pt={3} mt={3} p={3}>
     <Typography variant='h5' component='div' fontWeight={600}>
        Blogs and Articles
         </Typography>
        <Typography variant='subtitle2' color='#747474'>
          Read what's happening in Real Estate
        </Typography>
       
        <Slider {...settings}>
       
            {BlogsData.map((item)=>(
                  <Stack direction='row' spacing={4} mt={2}>
             <Card sx={{height:'100%' , boxShadow:'none'}}>
              <CardActionArea>
                <Box sx={{width:'100%' , height:'100%'}}>
                  <img src={item.image01} alt="/" style={{width:'90%'}} />
                  </Box>
              
                <Box mx={2} mt={1} mb={1}>
                <Typography   fontWeight={700}  >
                {item.title}
                </Typography> 
                

                
              

                <Typography  component='div' mt={2}>
                  {item.description}
                </Typography>
             </Box>
         
              </CardActionArea>
              

                    

                          
                        </Card>
                  </Stack>
                

                ))}
              
        </Slider>   


    </Box>
  )
}

export default Blogs
